function keydown(e) {
	var time = audio.currentTime;
	switch(e.keyCode) {
	case 70:
		for(var i=0; i<cList[0].length; i++)
			if(cList[0][i].s==0&&Math.abs(cList[0][i].t-time)<0.1) {
				cList[0][i].s = 1;
				result[0][0]++;
				break;
			}
		break;
	case 74:
		for(var i=0; i<cList[1].length; i++)
			if(cList[1][i].s==0&&Math.abs(cList[1][i].t-time)<0.1) {
				cList[1][i].s = 1;
				result[1][0]++;
				break;
			}
		break;
	case 68:
		for(var i=0; i<cList[2].length; i++)
			if(cList[2][i].s==0&&Math.abs(cList[2][i].t-time)<0.1) {
				cList[2][i].s = 1;
				result[2][0]++;
				break;
			}
		break;
	case 75:
		for(var i=0; i<cList[3].length; i++)
			if(cList[3][i].s==0&&Math.abs(cList[3][i].t-time)<0.1) {
				cList[3][i].s = 1;
				result[3][0]++;
				break;
			}
		break;
	case 32:
		if(audio.paused)
			audio.play();
		else
			audio.pause();
		break;
	case 37:
		audio.currentTime -= 10;
		break;
	case 39:
		audio.currentTime += 10;
		break;
	}
}
function keyup(e) {
	if(e.keyCode==75) {
		var time = audio.currentTime;
		for(var i=0; i<cList[3].length; i++) {
			if(cList[3][i].b&&cList[3][i].s==1&&cList[3][i].t<time-0.1&&cList[3][i].t+cList[3][i].d>time+0.1) {
				cList[3][i].s = -1;
				result[3][0]--;
				result[3][1]++;
				break;
			}
		}
	}
}

